sys_variable_value.value:
(function execute(inputs, outputs) {
    if (!inputs.spreadsheet || inputs.spreadsheet.trim() == "")
        throw "Provide Spreadsheet ID";
    if (!inputs.sheet || inputs.sheet.trim() == "")
        throw "Provide Sheet";
    if (!inputs.dest_spreadsheet || inputs.dest_spreadsheet.trim() == "")
        outputs.dest_spreadsheet = inputs.spreadsheet.trim();
    else
        outputs.dest_spreadsheet = inputs.dest_spreadsheet.trim();
  	outputs.spreadsheet = inputs.spreadsheet.trim();
    outputs.sheet = inputs.sheet.trim();
})(inputs, outputs);

